chrome.runtime.onMessage.addListener(function(req){
    if(req.type === 'additem'){
        chrome.storage.sync.get(['embed_pt1', 'embed_pt2'], function(res){
            embedList.push(res.embed_pt1.concat(res.embed_pt2))
            if(userThrsd(req.opt.topicList[0], req.opt.sensList[0], embedList[embedList.length-1]) == 1){
            listOfTxt.push(req.opt)     
            chrome.storage.sync.set({"listOfTxt": listOfTxt}, function(){})//setto lo storage
            updateOccurrence(req.opt.topicList)
            const l = req.opt.sensList.length
            for(let  i = 0; i < l; i++) setAvg(req.opt.sensList[i][1])
            setBadgeText(++c)
            }else{
            //bozza
            listOfTxt.push(req.opt)     
            chrome.storage.sync.set({"listOfTxt": listOfTxt}, function(){})//setto lo storage
            updateOccurrence(req.opt.topicList)
            const l = req.opt.sensList.length
            for(let  i = 0; i < l; i++) setAvg(req.opt.sensList[i][1])
            setBadgeText(++c)
            }
    })
    }
    if(req.type === 'rmvitem'){
        switch(structure.topicRef[req.opt.toRemove]){
            //salvare i W
            case 0: wPolitics = updateW(structure.topicRef[req.opt.toRemove], structure.xiList[req.opt.toRemove], 0.01); break
            case 1: wHealth = updateW(structure.topicRef[req.opt.toRemove], structure.xiList[req.opt.toRemove], 0.01); break;
            case 2: wJob = updateW(structure.topicRef[req.opt.toRemove], structure.xiList[req.opt.toRemove], 0.01); break;
            case 3: wTravel = updateW(structure.topicRef[req.opt.toRemove], structure.xiList[req.opt.toRemove], 0.01); break;
            case 4: wGeneral = updateW(structure.topicRef[req.opt.toRemove], structure.xiList[req.opt.toRemove], 0.01); break;
        }
        
        listOfTxt.splice(req.opt.toRemove, 1) 
        embedList.splice(req.opt.toRemove, 1)
        structure.xiList.splice(req.opt.toRemove,1 )
        structure.topicRef.splice(req.opt.toRemove,1 )
        if(listOfTxt.length == 0) chrome.storage.sync.set({"listOfTxt": ""}, function(){})
        else  chrome.storage.sync.set({"listOfTxt": listOfTxt}, function(){})
        setBadgeText(--c)
    }
    if(req.type === 'rmvAll'){
        listOfTxt = []
        embedList = []
        structure = {
            "xiList": [],
            "topicRef": [],
        }
        c = 0
        chrome.storage.sync.set({"listOfTxt": ""}, function(){})
        setBadgeText(c)
    }
    return true
})

function setBadgeText(c){
    if(c>999) chrome.browserAction.setBadgeText({"text": "999+"}); 
    else if(c==0) chrome.browserAction.setBadgeText({"text":""});
    else chrome.browserAction.setBadgeText({"text": c+""})
}

function updateOccurrence(topicList){
    chrome.storage.sync.get(['occurrence'], function(res){
        //res.occurrence[topic]++
        for(let i =0; i<topicList.length; i++) res.occurrence[topicList[i]]++
        chrome.storage.sync.set({"occurrence": res.occurrence}, function(){})
    })
}

function setAvg(sens){
    avg = avg + (sens - avg)/n_avg
    n_avg++
    chrome.storage.sync.set({"avg": avg}, function(){})
}

function updateW(topic, xi, C){
    let w = []
    switch(topic){
        case 0: w = wPolitics; break; 
        case 1: w = wHealth; break;
        case 2: w = wJob; break;
        case 3: w = wTravel; break;
        case 4: w = wGeneral; break;
        }
    //xi = math.reshape(xi, [514,1])
    //console.log(w)
    let tmp = w
    //console.log(xi)
    let loss = Math.max(0, 1-(-1 * math.dot(math.transpose(w), xi)))
    let tau = loss / Math.pow(math.norm(xi, 2), 2) + (1/2*C)
    let coeff = tau * -1
    //w += coeff * xi
    w = math.add(w, math.multiply(coeff, xi))
    //console.log(w)
    //console.log(typeof w)
    console.log(tmp === w)
    return w
}

function userThrsd(topic, sensList, X_embed){
    let w = []
    switch(topic){
        case 0: w = wPolitics; break; 
        case 1: w = wHealth; break;
        case 2: w = wJob; break;
        case 3: w = wTravel; break;
        case 4: w = wGeneral; break;
    }
//let xi = [[]]
//xi[0].push(xi[0].concat(X_embed, sensList[0], sensList[1]))
let xi = X_embed.concat(sensList[0], sensList[1])
Y_pred = math.dot(math.transpose(w), xi)
structure.xiList.push(xi)
structure.topicRef.push(topic)
console.log(Y_pred)
return (Y_pred<=0)?-1:1; 
}